import Link from 'next/link'
import logoImage from '../images/logo.png'

const Nav = () => (
    <nav className="navbar navbar-expand-lg navbar-light">
            <Link href="/"><a className="navbar-brand"><img src={logoImage} alt="La Garchère" /></a></Link>
            <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
                <span className="navbar-toggler-icon"></span>
            </button>

            <div className="collapse navbar-collapse nav_uitklap stroke" id="navbarSupportedContent">
                <ul className="navbar-nav mr-auto ul-active">
                    <li className="nav-item">
                        <Link href="/kamers"><a className="nav-link" >Kamers</a></Link>
                    </li>
                    <li className="nav-item">
                        <Link href="/activiteiten"><a className="nav-link" >Activiteit</a></Link>
                    </li>
                    <li className="nav-item">
                        <Link href="/contact"><a className="nav-link">Contact</a></Link>
                    </li>
                </ul>
                <button><Link href="/reserveren"><a>Reserveren</a></Link></button>
            </div>
    </nav>
);

export default Nav;


